import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes, useNavigate } from 'react-router-dom';
import Addition from './pages/Addition';
import Division from './pages/Division';
import Multiplication from './pages/Multiplication';
import Subtraction from './pages/Subtraction';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-200 flex flex-col">
        {/* Header */}
        <header className="bg-blue-600 text-white p-4 text-center">
          <h1 className="text-3xl font-bold">Aplikasi Operasi Matematika</h1>
          <p>Silakan pilih operasi yang ingin dilakukan.</p>
        </header>

        {/* Navbar */}
        <nav className="p-4 text-center space-x-4">
          <NavLink to="/addition">Penjumlahan</NavLink>
          <NavLink to="/subtraction">Pengurangan</NavLink>
          <NavLink to="/multiplication">Perkalian</NavLink>
          <NavLink to="/division">Pembagian</NavLink>
        </nav>

        {/* Konten */}
        <main className="flex-grow p-4">
          <Routes>
            <Route path="/addition" element={<Addition />} />
            <Route path="/subtraction" element={<Subtraction />} />
            <Route path="/multiplication" element={<Multiplication />} />
            <Route path="/division" element={<Division />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

function NavLink({ to, children }) {
  const navigate = useNavigate();
  return (
    <button
      onClick={() => navigate(to)}
      className="bg-blue-500 text-white py-2 px-4 rounded-lg hover:bg-blue-600"
    >
      {children}
    </button>
  );
}

export default App;
